pragma solidity ^0.5.0;

contract MyContract {
address[16] public adoptedDogs;

function adopted(uint dogIndex) public returns (bool){

    require(dogIndex >= 0 && dogIndex <= 15 , "OUTSIDE RANGE");

    bool adoptedSuccess = true;

    if(adoptedDogs[dogIndex] == address(0) ){
        adoptedDogs[dogIndex] = msg.sender;
    }else {
        adoptedSuccess = false;
    }

    return adoptedSuccess;
}


function getAdoptedDogs() public view returns (address[16] memory){
        return adoptedDogs;
}

}
